! function () {
    "use strict";
    new
    Vue({
            el: "#app",
            data: {
                nickname: "",
                toy: "",
                user: "",
                subscribe: "",
                sending: !1,
                apiUri: "https://script.google.com/macros/s/AKfycbymoR5zRT3JIMAngRx5j5oBPS0WnPXsdegtxhzFrhn0yNNZk9icsQssKCGPZtNLQBcV/exec"
            },
            methods: {
                sendData: function () {
                    var
                        t = this;
                    this.sending = !0;
                    var e = new
                    Date, n = e.getFullYear(), s = e.getMonth() + 1, c = e.getDay(), a = e.getHours(), i = e.getMinutes(), o = e.getSeconds(), r = "".concat(n, "-").concat(s, "-").concat(c, "
                        ").concat(a,": ").concat(i,": ").concat(o),h=new
                        FormData; h.append("today", r), h.append("nickname", this.nickname), h.append("toy", this.toy), h.append("user", this.user), h.append("subscribe", this.subscribe);
                        var
                            u = {
                                method: "POST",
                                body: h,
                                redirect: "follow"
                            }; fetch(this.apiUri, u).then((function (t) {
                            return
                            t.text()
                        })).then((function (e) {
                            "success" === e && (t.sending = !1, alert("資料已成功送出，我們下次見~"), t.nickname = t.toy = t.user = t.subscribe = "")
                        })).catch((function (t) {
                            return
                            console.log("error", t)
                        }))
                    }, submit: function () {
                        this.nickname.length <=
                            0 ? alert("請填寫江湖稱號") : this.toy.length <= 0 ? alert("請填寫你的玩具") : this.user.length <= 0 ? alert("請選擇你來過的次數") : this.subscribe.length <= 0 ? alert("請選擇你是否會訂閱") : this.sendData()
                    }
                }
            })
    }();
